import React from 'react';
import { Card, Col } from 'react-bootstrap';

const Service = (props) => {
    const { title, body, image } = props.service;
    return (
        <div>
            <Col>
                <Card>
                    <Card.Img variant="top" className="h-50" src={image} />
                    <Card.Body>
                        <Card.Title>{title}</Card.Title>
                        <Card.Text>
                            {body}
                        </Card.Text>
                    </Card.Body>
                </Card>
            </Col>
        </div>
    );
};

export default Service;
